import React from 'react'

const ProjectNav = ({dataItems}) => {
    // remove duplicates
    const setCategories = ['all',...new Set(dataItems.map((item) => item.category))]
    console.log(setCategories)

    const filterCategories = dataItems.filter((elem, index, arr) => {
       return arr.indexOf(elem) === index
    })
    console.log(filterCategories)


    return (
        <nav style={{color: 'white'}}>
            {dataItems.map((category, index) => {
                <h1 key={index}>{category}</h1>
            })}
        </nav>
    )
}

export default ProjectNav
